import axios from 'axios';
import React, { useState } from 'react'

export default function Rating({ rating, productid }) {
    const [reviews, setreviews] = useState({ points: 5, review: '' });
    const changeHandler = (e) => {
        setreviews({ ...reviews, [e.target.name]: e.target.value });
    }
    const ratingHandler = (e) => {
        setreviews({ ...reviews, [e.target.name]: Number(e.target.value) });
    }
    const submitHandler = (e) => {
        e.preventDefault();
        axios.post(`http://localhost:5000/api/products/rating/${productid}`, reviews, { headers: { 'x-token': `${localStorage.getItem('token')}` } }).then(res => { alert(res.data); window.location.reload(false); });
    }
    return (
        <div className='rating'>
            <h2 className="ratinghead">Review</h2>
            <div className="allreview">
                {rating.map(rat => {
                    return (
                        <div key={rat._id} className="singlereview">
                            <div className="ratname"><b>{rat.reviewby.name}</b></div>
                            <div className="rating">{rat.points === 5 && <img src='data:image/png;base64,' alt='5 stars' width={90} height={25} />}</div>
                            <div className="rating">{rat.points === 4 && <img src='data:image/png;base64,' alt='4 stars' width={90} height={25} />}</div>
                            <div className="rating">{rat.points === 3 && <img src='data:image/png;base64,' alt='3 stars' width={90} height={25} />}</div>
                            <div className="rating">{rat.points === 2 && <img src='data:image/png;base64,' alt='2 stars' width={90} height={25} />}</div>
                            <div className="rating">{rat.points === 1 && <img src='data:image/png;base64,' alt='1 stars' width={90} height={25} />}</div>
                            <div className="ratingtime">{rat.createdAt}</div>
                            <div className="ratreview">{rat.review}</div>
                        </div>
                    )
                })}
            </div>
            <div className="writereview">
                <h2 className="writehead">Write a customer review</h2>
                <div className="writeform">
                    <form className='reviewform' onSubmit={submitHandler}>
                        <h4>Rating</h4>
                        <select onChange={ratingHandler} name="points" id="points">
                            <option value={5}>5-Exelent</option>
                            <option value={4}>4-Good</option>
                            <option value={3}>3-Average</option>
                            <option value={2}>2-Bad</option>
                            <option value={1}>1-Poor</option>
                        </select>
                        <input onChange={changeHandler} type="text" name="review" id="review" placeholder='comment' />
                        <input className='subrev' type="submit" value="submit" />
                    </form>
                </div>
            </div>
        </div>
    )
}
